import{_ as e,o as t,c as o,a5 as a}from"./chunks/framework.DdR9R22r.js";const i="/arona/assets/OpenAI.fVrXCq4L.png",b=JSON.parse('{"title":"OpenAI","description":"","frontmatter":{},"headers":[],"relativePath":"integrations/openai.md","filePath":"integrations/openai.md"}'),n={name:"integrations/openai.md"},r=a('<h1 id="openai" tabindex="-1">OpenAI <a class="header-anchor" href="#openai" aria-label="Permalink to &quot;OpenAI&quot;">​</a></h1><p>OpenAI module is used to connect to the OpenAI API to generate text, images, and more.</p><p>It&#39;s compatible with any OpenAI-compatible API service, including the self-hosted OpenAI API.</p><p><img src="'+i+'" alt="OpenAI"></p><h2 id="introduction" tabindex="-1">Introduction <a class="header-anchor" href="#introduction" aria-label="Permalink to &quot;Introduction&quot;">​</a></h2><p>The OpenAI integration allows you to interact with the OpenAI API to generate text, images, and more. You can use this integration to create AI-powered workflows that generate content, answer questions, and more.</p><h2 id="prerequisites" tabindex="-1">Prerequisites <a class="header-anchor" href="#prerequisites" aria-label="Permalink to &quot;Prerequisites&quot;">​</a></h2><p>Before you can set up the OpenAI integration, you need to have the following:</p><ul><li>An account from an OpenAI-compatible API service</li><li>An API key from the service</li></ul><h2 id="setting-up-the-integration" tabindex="-1">Setting up the integration <a class="header-anchor" href="#setting-up-the-integration" aria-label="Permalink to &quot;Setting up the integration&quot;">​</a></h2><p>To set up the OpenAI integration, you need to create an API key in your OpenAI account. You can do this by following these steps:</p><ol><li>Log in to your OpenAI-compatible API service account.</li><li>Apply for an API key. If you&#39;re using the self-hosted OpenAI API, and it seems no api key is needed, you can fill in the <code>apiKey</code> field with <code>emptyButRequired</code> or any string instead (Must not be empty).</li><li>Copy the API key into the <code>apiKey</code> field (see the <a href="#configure">Configure</a> section).</li><li>Use the API key in your workflows to interact with the OpenAI API.</li></ol><h3 id="configure" tabindex="-1">Configure <a class="header-anchor" href="#configure" aria-label="Permalink to &quot;Configure&quot;">​</a></h3><p>Here are the options you can configure for the OpenAI integration:</p><table tabindex="0"><thead><tr><th>Option</th><th>Description</th></tr></thead><tbody><tr><td><a href="#enable"><code>enable</code></a></td><td>Whether the provider is enabled or not.</td></tr><tr><td><a href="#baseurl"><code>baseUrl</code></a></td><td>The base URL of the OpenAI API.</td></tr><tr><td><a href="#apikey"><code>apiKey</code></a></td><td>The API key of the OpenAI API.</td></tr><tr><td><a href="#chatmodel"><code>chatModel</code></a></td><td>The chat model to use.</td></tr></tbody></table><h4 id="enable" tabindex="-1"><code>enable</code> <a class="header-anchor" href="#enable" aria-label="Permalink to &quot;`enable`&quot;">​</a></h4><p><em>type: <code>boolean</code></em></p><p>Whether the provider is enabled or not.</p><h4 id="baseurl" tabindex="-1"><code>baseUrl</code> <a class="header-anchor" href="#baseurl" aria-label="Permalink to &quot;`baseUrl`&quot;">​</a></h4><p><em>type: <code>string</code></em></p><p>The base URL of the OpenAI API.</p><p>The default value is <code>https://web-tech-tw.eu.org/openai/v1</code>, it&#39;s a Google Gemini API proxy.</p><p>To get more infomaion about the proxy, you can visit the <a href="https://github.com/ai-tech-tw/openai" target="_blank" rel="noreferrer">OpenAI &lt;=&gt; Gemini API Protocol Conversion Gateway</a>.</p><p>You can replace it with the OpenAI API URL or your own proxy/server instance.</p><h4 id="apikey" tabindex="-1"><code>apiKey</code> <a class="header-anchor" href="#apikey" aria-label="Permalink to &quot;`apiKey`&quot;">​</a></h4><p><em>type: <code>string</code></em></p><p>The API key of the OpenAI API.</p><p>You should obtain this key from the provider you filled in the <code>baseUrl</code> field.</p><p>If you&#39;re using the default value, you can get the key from the <a href="https://aistudio.google.com/botToken" target="_blank" rel="noreferrer">Get API key | Google AI Studio</a>.</p><p>If the API provider asked you to make the <code>apiKey</code> field empty, you should fill the filed with <code>emptyButRequired</code> or any string instead due to the restriction from OpenAI client module (Must not be empty).</p><h4 id="chatmodel" tabindex="-1"><code>chatModel</code> <a class="header-anchor" href="#chatmodel" aria-label="Permalink to &quot;`chatModel`&quot;">​</a></h4><p><em>type: <code>string</code></em></p><p>The chat model to use.</p><p>The default value is <code>gpt-3.5-turbo</code>, it&#39;s a Google Gemini 1.0 model (via proxy).</p><p>You can replace it with the model you want to use.</p><hr><blockquote><p>The copyright of the brand logos belongs to the respective brand owners.</p></blockquote>',37),d=[r];function h(p,c,l,s,u,f){return t(),o("div",{"data-pagefind-body":!0},d)}const y=e(n,[["render",h]]);export{b as __pageData,y as default};
